import React from "react";
import "./TestSelector.css";
import { FaDiscord} from "react-icons/fa";
// import { GrMail } from "react-icons/fa";
// import { AiTwotoneMail } from "react-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faDiscord, faInstagram, faFacebook } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-regular-svg-icons";
import logo2 from "../../assets/logo-lux.svg";

function TestSelector() {
  return (
    <section>
      <footer className="footer-container">
        <div className="footer-colonne1">
          <div>
            <span className="text-footer-colonne1">
              <a href="mailto:luxresort@metalyde.com">
              <FontAwesomeIcon icon={faEnvelope} className="icons-socials"/>
                </a>
            </span>
          </div>
          <div>
            <span className="text-footer-colonne1">
              <a href="https://discord.com/invite/YbnVGG3JdP">
                <FontAwesomeIcon icon={faDiscord} className="icons-socials"/> 
              </a>
            </span>
          </div>
          <span className="text-footer-colonne1">
            <div>Copyright © 2022 LUX* Tous droits réservés</div>
          </span>
        </div>
        <div className="footer-colonne2">
          <span className="text-footer-colonne2">
            <a href="https://www.instagram.com/luxresorts/">
              <FontAwesomeIcon icon={faInstagram} className="icons-socials" />
              </a>
          </span>
          <span className="text-footer-colonne2">
            <a href="https://www.facebook.com/luxresorts/">
            <FontAwesomeIcon icon={faFacebook} className="icons-socials"/> 
            </a>
          </span>
        </div>

        <div className="footer-colonne3">
          <div>LUX* RESORTS & HOTELS</div>
        </div>

       <div><style type="text/css">

                    fill: #FFFFFF;

</style></div>


       <div>


       </div>
      </footer>

    </section>
  );
}

export default TestSelector;
